import {WorksCardStyled, 
    WorksCardNumber,
    WorksCardHeader
} from "./WorksCard.styled"


export const WorksCard = ({number, header, text}) => {
    return (
        <WorksCardStyled>
         <WorksCardNumber>{number}</WorksCardNumber>
         <WorksCardHeader>{header}</WorksCardHeader>
         <p>{text}</p>
       </WorksCardStyled>
    );
  };
